// node scripts to write base64 images to public/images
import { writeFileSync, mkdirSync } from 'node:fs';
import { dirname } from 'node:path';
const files = [
{ path: 'public/images/promo-triple-pizza.webp', b64: '' },
{ path: 'public/images/promo-mediana-agrandada-xl-1.webp', b64: '' },
{ path: 'public/images/promo-buenazooo-4medianas.webp', b64: '' },
{ path: 'public/images/promo-mediana-agrandada-xl-2.webp', b64: '' },
{ path: 'public/images/promo-2x-mediana-xl.webp', b64: '' },
{ path: 'public/images/promo-mediana-especial.webp', b64: '' },
];

for (const f of files) {
  mkdirSync(dirname(f.path), { recursive: true });
  writeFileSync(f.path, Buffer.from(f.b64, 'base64'));
  console.log('Wrote', f.path);
}
